    const [currentUser, setCurrentUser] = useState(JSON.parse(sessionStorage.getItem('admin')));

    if(currentUser!==null){
        return children;
    }
    else{
        Swal.fire({
            icon: 'error',
            title : 'Error',
            text: 'Please Login First!!',
        })
        return <Navigate to="/main/login" />
    }
}

export default AdminAuth;
